import React, { useState, useEffect, useMemo } from "react";
import { AiFillDelete } from "react-icons/ai";
import { BiSearchAlt2 } from "react-icons/bi";
import "aos/dist/aos.css";
import "./styles/project.css";

const Project = () => {
  const [works, setWorks] = useState({ doNow: [], schedule: [], delegate: [], drop: [] });
  const [completedWorks, setCompletedWorks] = useState([]);
  const [viewMode, setViewMode] = useState("ongoing");
  const [searchQuery, setSearchQuery] = useState("");

  // Lấy dữ liệu từ localStorage khi component được mount
  useEffect(() => {
    const storedWorks = JSON.parse(localStorage.getItem("works")) || { doNow: [], schedule: [], delegate: [], drop: [] };
    const storedCompletedWorks = JSON.parse(localStorage.getItem("worksdone")) || [];
    setWorks(storedWorks);
    setCompletedWorks(storedCompletedWorks);
  }, []);

  // Cập nhật localStorage khi works hoặc completedWorks thay đổi
  useEffect(() => {
    localStorage.setItem("works", JSON.stringify(works));
    localStorage.setItem("worksdone", JSON.stringify(completedWorks));
  }, [works, completedWorks]);

  // Bộ lọc works theo trạng thái hiển thị (ongoing/completed) và tìm kiếm
  const filteredWorks = useMemo(() => {
    const allOngoingWorks = Object.values(works).flat(); // Gộp tất cả works từ các danh mục
    const filtered = viewMode === "ongoing" ? allOngoingWorks : completedWorks;

    // Áp dụng tìm kiếm nếu có query
    if (searchQuery.trim() === "") return filtered;
    return filtered.filter((work) =>
      work.name.toLowerCase().includes(searchQuery.trim().toLowerCase())
    );
  }, [viewMode, works, completedWorks, searchQuery]);

  // Hàm xóa work
  const handleDeleteWork = (workId, isCompleted) => {
    if (isCompleted) {
      setCompletedWorks((prevCompletedWorks) =>
        prevCompletedWorks.filter((work) => work.id !== workId)
      );
    } else {
      setWorks((prevWorks) => {
        const updatedWorks = { ...prevWorks };
        Object.keys(updatedWorks).forEach((type) => {
          updatedWorks[type] = updatedWorks[type].filter((work) => work.id !== workId);
        });
        return updatedWorks;
      });
    }
  };

  return (
    <div className="main-form" data-aos="zoom-in">
      <div className="search-bar">
        <h1>Projects</h1>
        <input
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          type="search"
          placeholder={`Search ${viewMode === "ongoing" ? "ongoing" : "completed"} works`}
        />
        <button id="search-bt">
          <BiSearchAlt2 size={22} />
        </button>
      </div>
      <div className="view-toggle">
        <button
          className={viewMode === "ongoing" ? "active" : ""}
          onClick={() => setViewMode("ongoing")}
        >
          On Going Works
        </button>
        <button
          className={viewMode === "completed" ? "active" : ""}
          onClick={() => setViewMode("completed")}
        >
          Completed Works
        </button>
      </div>
      <div className="item-list">
        {filteredWorks.length === 0 ? (
          <h3 id="no-todo">
            {viewMode === "ongoing" ? "No ongoing works" : "No completed works"}
          </h3>
        ) : (
          <ul>
            {filteredWorks.map((work) => (
              <li key={work.id}>
                <label htmlFor="" className="item-name">
                  <input
                    type="checkbox"
                    checked={viewMode === "completed"}
                    readOnly
                  />
                  {work.name} {/* Hiển thị tên Work */}
                </label>
                <button id="del-bt" onClick={() => handleDeleteWork(work.id, viewMode === "completed")}>
                  <AiFillDelete size={20} color="#FF6969" />
                </button>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default Project;
